import './Css/Footer.css'

const Footer = () =>{
    return(
        <>
        <div className="foot-main">
            <div className="foot-left">
                <button type="button" className="button-nav-logo"><span className="logo"/></button>
                <p>Join our mailing list to stay in the loop with our newest feature releases, NFT drops, and tips.</p>
                <div className="navbar-searchbar">
                    <input class="search_input" type="text" name="" placeholder="items, collections, and accounts"/>
                </div>
                <button type="button" className="search_icon">
                        <span className="icon-search"/>
                </button>
            </div>
        </div>
        </>
    )
};
export default Footer;
